import React, { useState } from 'react';

// --- SVG Icon Components (for a self-contained file) ---
const HomeIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <path d="m3 9 9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path>
    <polyline points="9 22 9 12 15 12 15 22"></polyline>
  </svg>
);

const UsersIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <path d="M16 21v-2a4 4 0 0 0-4-4H6a4 4 0 0 0-4 4v2"></path>
    <circle cx="9" cy="7" r="4"></circle>
    <path d="M22 21v-2a4 4 0 0 0-3-3.87"></path>
    <path d="M16 3.13a4 4 0 0 1 0 7.75"></path>
  </svg>
);

const FileIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <path d="M14.5 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V7.5L14.5 2z"></path>
    <polyline points="14 2 14 8 20 8"></polyline>
  </svg>
);

const ActivityIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <polyline points="22 12 18 12 15 21 9 3 6 12 2 12" />
  </svg>
);

const SettingsIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <path d="M12.22 2h-.44a2 2 0 0 0-2 2v.18a2 2 0 0 1-1 1.73l-.43.25a2 2 0 0 1-2 0l-.15-.08a2 2 0 0 0-2.73.73l-.22.38a2 2 0 0 0 .73 2.73l.15.1a2 2 0 0 1 0 2l-.15.08a2 2 0 0 0-.73 2.73l.22.38a2 2 0 0 0 2.73.73l.15-.08a2 2 0 0 1 2 0l.43.25a2 2 0 0 1 1 1.73V20a2 2 0 0 0 2 2h.44a2 2 0 0 0 2-2v-.18a2 2 0 0 1 1-1.73l.43-.25a2 2 0 0 1 2 0l.15.08a2 2 0 0 0 2.73-.73l.22-.38a2 2 0 0 0-.73-2.73l-.15-.08a2 2 0 0 1 0-2l.15-.08a2 2 0 0 0 .73-2.73l-.22-.38a2 2 0 0 0-2.73-.73l-.15.08a2 2 0 0 1-2 0l-.43-.25a2 2 0 0 1-1-1.73V4a2 2 0 0 0-2-2z"></path>
    <circle cx="12" cy="12" r="3"></circle>
  </svg>
);

const MoreVerticalIcon = ({ className }) => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}>
    <circle cx="12" cy="12" r="1"></circle>
    <circle cx="12" cy="5" r="1"></circle>
    <circle cx="12" cy="19" r="1"></circle>
  </svg>
);

// --- Mock Data ---
const stats = [
  { name: 'Total Users', value: '1,428', change: '+12.5%', icon: UsersIcon, color: 'bg-blue-500' },
  { name: 'Total Files', value: '25,690', change: '+8.2%', icon: FileIcon, color: 'bg-green-500' },
  { name: 'Storage Used', value: '1.2 TB', change: '+2.1%', icon: HomeIcon, color: 'bg-yellow-500' },
  { name: 'Active Sessions', value: '312', change: '-1.8%', icon: ActivityIcon, color: 'bg-indigo-500' }
];

const users = [
  { name: 'Alice Johnson', email: 'alice.j@example.com', role: 'Premium', storageUsed: '15.2 GB', joined: '2023-01-15', status: 'Active', avatar: `https://i.pravatar.cc/150?u=a042581f4e29026704d` },
  { name: 'Bob Williams', email: 'bob.w@example.com', role: 'Standard', storageUsed: '4.8 GB', joined: '2023-02-20', status: 'Active', avatar: `https://i.pravatar.cc/150?u=a042581f4e29026705d` },
  { name: 'Charlie Brown', email: 'charlie.b@example.com', role: 'Standard', storageUsed: '9.1 GB', joined: '2023-03-10', status: 'Suspended', avatar: `https://i.pravatar.cc/150?u=a042581f4e29026706d` },
  { name: 'Diana Miller', email: 'diana.m@example.com', role: 'Premium', storageUsed: '25.6 GB', joined: '2023-04-05', status: 'Active', avatar: `https://i.pravatar.cc/150?u=a042581f4e29026707d` },
  { name: 'Ethan Davis', email: 'ethan.d@example.com', role: 'Free', storageUsed: '1.2 GB', joined: '2023-05-22', status: 'Active', avatar: `https://i.pravatar.cc/150?u=a042581f4e29026708d` },
];

// --- Sidebar Component ---
const Sidebar = ({ activeView, setActiveView }) => {
  const navItems = [
    { name: 'Dashboard', icon: HomeIcon },
    { name: 'Users', icon: UsersIcon },
    { name: 'Files', icon: FileIcon },
    { name: 'System Activity', icon: ActivityIcon },
    { name: 'Settings', icon: SettingsIcon },
  ];

  return (
    <aside className="w-64 flex-shrink-0 bg-gray-800 text-gray-300 flex flex-col p-4">
      <div className="text-white text-2xl font-bold mb-10 flex items-center gap-2">
        <svg xmlns="http://www.w3.org/2000/svg" width="28" height="28" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
          <rect x="3" y="11" width="18" height="11" rx="2" ry="2"></rect>
          <path d="M7 11V7a5 5 0 0 1 10 0v4"></path>
        </svg>
        <span>Digital Locker</span>
      </div>
      <nav className="flex-grow">
        <ul>
          {navItems.map(item => (
            <li key={item.name}>
              <button
                onClick={() => setActiveView(item.name)}
                className={`w-full text-left flex items-center gap-3 px-4 py-3 my-1 rounded-lg transition-colors ${
                  activeView === item.name
                    ? 'bg-blue-600 text-white'
                    : 'hover:bg-gray-700 hover:text-white'
                }`}
              >
                <item.icon className="h-5 w-5" />
                <span>{item.name}</span>
              </button>
            </li>
          ))}
        </ul>
      </nav>
      <div className="mt-auto">
        <div className="bg-gray-700/50 p-4 rounded-lg text-center">
          <p className="text-sm">Upgrade to Pro Plan</p>
          <p className="text-xs text-gray-400 mt-1 mb-3">Unlock advanced analytics and features.</p>
          <button className="w-full bg-blue-600 text-white py-2 rounded-lg text-sm font-semibold hover:bg-blue-700 transition-colors">
            Upgrade
          </button>
        </div>
      </div>
    </aside>
  );
};

const Header = ({ title }) => (
  <header className="bg-white shadow-sm p-4 flex justify-between items-center">
    <h1 className="text-2xl font-semibold text-gray-800">{title}</h1>
    <div className="flex items-center gap-4">
      <input
        type="search"
        placeholder="Search users, files..."
        className="px-4 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500 focus:outline-none transition w-64"
      />
      <div className="flex items-center gap-2">
        <img src={`https://i.pravatar.cc/150?u=admin`} alt="Admin Avatar" className="h-10 w-10 rounded-full" />
        <div>
          <p className="font-semibold text-sm">Admin User</p>
          <p className="text-xs text-gray-500">System Administrator</p>
        </div>
      </div>
    </div>
  </header>
);

const StatCard = ({ item }) => (
  <div className="bg-white p-6 rounded-xl shadow-md flex items-start justify-between transition-transform hover:scale-105">
    <div>
      <p className="text-sm font-medium text-gray-500">{item.name}</p>
      <p className="text-3xl font-bold text-gray-800 mt-1">{item.value}</p>
      <p className={`text-xs mt-2 ${item.change.startsWith('+') ? 'text-green-600' : 'text-red-600'}`}>
        {item.change} vs last month
      </p>
    </div>
    <div className={`${item.color} p-3 rounded-full text-white`}>
      <item.icon className="h-6 w-6" />
    </div>
  </div>
);

const UserTable = () => (
  <div className="bg-white p-6 rounded-xl shadow-md mt-6">
    <h2 className="text-xl font-semibold text-gray-800 mb-4">User Management</h2>
    <div className="overflow-x-auto">
      <table className="w-full text-left">
        <thead className="border-b bg-gray-50">
          <tr>
            <th className="p-4 font-medium text-gray-600">Name</th>
            <th className="p-4 font-medium text-gray-600">Role</th>
            <th className="p-4 font-medium text-gray-600">Storage Used</th>
            <th className="p-4 font-medium text-gray-600">Joined Date</th>
            <th className="p-4 font-medium text-gray-600">Status</th>
            <th className="p-4 font-medium text-gray-600">Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.email} className="border-b hover:bg-gray-50">
              <td className="p-4 flex items-center gap-3">
                <img src={user.avatar} alt={user.name} className="h-10 w-10 rounded-full" />
                <div>
                  <p className="font-semibold text-gray-800">{user.name}</p>
                  <p className="text-sm text-gray-500">{user.email}</p>
                </div>
              </td>
              <td className="p-4 text-gray-700">{user.role}</td>
              <td className="p-4 text-gray-700">{user.storageUsed}</td>
              <td className="p-4 text-gray-700">{user.joined}</td>
              <td className="p-4">
                <span className={`px-3 py-1 text-xs font-semibold rounded-full ${
                  user.status === 'Active' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'
                }`}>
                  {user.status}
                </span>
              </td>
              <td className="p-4">
                <button className="text-gray-500 hover:text-gray-800">
                  <MoreVerticalIcon className="h-5 w-5" />
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </div>
);

const DashboardView = () => (
  <>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      {stats.map(item => (
        <StatCard key={item.name} item={item} />
      ))}
    </div>
    <div className="mt-6">
      <UserTable />
    </div>
  </>
);

const PlaceholderView = ({ title }) => (
  <div className="bg-white p-10 rounded-xl shadow-md mt-6 flex flex-col items-center justify-center text-center h-96">
    <h2 className="text-2xl font-semibold text-gray-800">{title}</h2>
    <p className="text-gray-500 mt-2">This feature is under construction.</p>
    <div className="mt-6">
      {title === 'Files' && <FileIcon className="h-16 w-16 text-gray-300" />}
      {title === 'System Activity' && <ActivityIcon className="h-16 w-16 text-gray-300" />}
      {title === 'Settings' && <SettingsIcon className="h-16 w-16 text-gray-300" />}
    </div>
  </div>
);

// --- Main Component ---
const AdminDashboard = () => {
  const [activeView, setActiveView] = useState('Dashboard');

  const renderContent = () => {
    switch (activeView) {
      case 'Dashboard':
        return <DashboardView />;
      case 'Users':
        return <UserTable />;
      case 'Files':
        return <PlaceholderView title="Files" />;
      case 'System Activity':
        return <PlaceholderView title="System Activity" />;
      case 'Settings':
        return <PlaceholderView title="Settings" />;
      default:
        return <DashboardView />;
    }
  };

  return (
    <div className="flex h-screen bg-gray-100 font-sans">
      <Sidebar activeView={activeView} setActiveView={setActiveView} />
      <main className="flex-1 flex flex-col overflow-hidden">
        <Header title={activeView} />
        <div className="flex-1 p-6 overflow-y-auto">
          {renderContent()}
        </div>
      </main>
    </div>
  );
};

export default AdminDashboard;
